 }

 tnailOne:any=React.createRef();

 shoot(){
  alert('hello')
  this.tnailOne.display='block';
}



render(){

  return(

    <div className = 'disp'>

        <img className = 'hdr' src = {require('./images/hdr.jpg')} alt = "Nandana in Maize Field"/>

        <p className = 'txt_one'>My Photo Albums</p>

        <div className = 'lne_a'></div>

        <div className = 'cont_a'>

        <figure>
            <img className = 'img_hvr' onClick = {this.shoot} src = {require('./images/Album-1/01.jpg')} alt = 'Baby Nandana' />
            <figcaption className = "cption">Those early days...</figcaption>
        </figure>

        </div>

        <div className = 'albm' ref = {this.tnailOne}>

        </div>





    </div>
  )
}

